import React, { Component } from "react";
import GoogleMapReact from "google-map-react";
import axios from 'axios'

import './Marker.scss';

import marker from '../../../Assets/Images/pin.png'

const googleAPIKey = "AIzaSyCq1D3cnZycxn5PCwiahpHscgep3yoN35U";


const Marker = ({ center, zoom, data }) => {
  console.log(center)
  console.log(zoom)
  console.log(data)
  return (
    <GoogleMapReact
      bootstrapURLKeys={{ key: googleAPIKey }}
      // yesIWantToUseGoogleMapApiInternals={true}
      defaultZoom={zoom}
      defaultCenter={center}
    >
      {data.map(item => {
        return (
          <div  className="marker" lat={item.latitude} lng={item.longitude}>
            <img src={marker} alt="pin" />
          </div>
        );
      })}
    </GoogleMapReact>
  );
};

 export default Marker;
